import React, { Component } from "react";

export class AddTodo extends Component {
  state = {
    tittle: "",
  };
  render() {
    return (
      <form style={{ display: "flex" }}>
        <input
          type="text"
          name="tittle"
          style={{ flex: "10", padding: "5px" }}
          placeholder=" Add Todo..."
          value={this.state.tittle}
        />
        <input
          type="submit"
          value="Submit"
          className="btn"
          style={{ flex: "1" }}
        />
      </form>
    );
  }
}

export default AddTodo;
